import React, { Component } from "react";
class Items extends Component {
  render() {
    let data;
    const countries = fetch("https://restcountries.eu/rest/v2/all")
      .then((res) => res.json())
      .then((res) => (data = res.data));
    console.log(data);
    return (
      <StyledHome>
        {countries && <Filters />}
        <CountryWrapper>
          {countries &&
            countries.map((el, index) => (
              <List_element country={el} id={index} key={index}>
                {el.name}
              </List_element>
            ))}
        </CountryWrapper>
      </StyledHome>
    );
  }
}
export default Items;
